(31408, 8422, '_wpb_post_custom_css', '.banner, .st-breadcrumb{\r\n    display: none;\r\n}\r\n.st-become-banner h2{\r\n    margin-bottom: 25px;\r\n}\r\n.st-become-banner h4{\r\n    font-weight: normal;\r\n    font-size: 16px;\r\n}\r\n.st-become-banner a.btn{\r\n    background: #FA5535;\r\n    font-size: 15px;\r\n}\r\n.st-number-box p{\r\n    font-size: 13px;\r\n}\r\n.st-number-box .st-number-circle p{\r\n    width: 70px;\r\n    height: 70px;\r\n    border: 2px solid #5191FA;\r\n    border-radius: 50%;\r\n    text-align: center;\r\n    line-height: 69px;\r\n    font-size: 40px;\r\n    color: #5191FA;\r\n    transition: all 0.3s;\r\n}\r\n.st-number-box .vc_column-inner:hover .st-number-circle p {\r\n    box-shadow: 0px 0px 6px 2px #5191FA;\r\n}\r\n.st-number-box h3{\r\n    font-size: 17px;\r\n    font-weight: 450;\r\n    margin-top: 3px;\r\n}\r\n.st-become-feature .vc_column-inner{\r\n    border: 1px solid #dfdfdf;\r\n    border-radius: 8px;\r\n    padding: 50px;\r\n    margin-bottom: 30px;\r\n    transition: all 0.3s;\r\n}\r\n.st-become-feature .vc_column-inner:hover{\r\n    box-shadow: 0px 0px 6px 2px #5191FA;\r\n}\r\n.st-become-feature h3{\r\n    font-size: 17px;\r\n    text-align: center;\r\n}\r\n.st-become-feature .wpb_content_element{\r\n    margin-bottom: 25px;\r\n    text-align: center;\r\n}\r\n.st-become-feature .wpb_content_element:nth-child(2){\r\n    margin-bottom: 16px;\r\n}\r\n.st-become-feature .wpb_content_element:last-child{\r\n    margin-bottom: 0px;\r\n}\r\n.st-become-feature .wpb_content_element p{\r\n    font-size: 14px;\r\n    color: #666;\r\n}\r\n.st-become-feature-wrapper a.btn{\r\n    background: #FA5535;\r\n    font-size: 15px;\r\n    padding: 17px 30px;\r\n}\r\n.st-become-faqs .wpb_wrapper h3{\r\n    font-size: 18px;\r\n}\r\n.st-become-faqs .wpb_wrapper h3 img{\r\n    width: 30px;\r\n    height: auto;\r\n    position: relative;\r\n    top: -2px;\r\n    margin-right: 10px;\r\n}\r\n.st-become-faqs .wpb_wrapper p{\r\n    font-size: 15px;\r\n    color: #666;\r\n    margin-top: 15px;\r\n}'),
